import React from 'react';
import { Link } from 'react-router-dom';
import './HomePage.css';

const HomePage = () => {
  return (
    <div className="container home-page">
      <div className="header-section">
        <h1 className="main-heading">WELCOME</h1>
        <p className="description">
          Empowering educators and students with state-of-the-art AI technology. Our AI grading system offers unparalleled accuracy and efficiency, transforming the way assessments are conducted. Join us in revolutionizing education, both online and offline.
        </p>
        <Link to="/get-started" className="btn btn-primary call-to-action">
          GET STARTED
        </Link>
      </div>
    </div>
  );
};

export default HomePage;
